export function PositionsList({ chord }) {
  // console.log(chord);
  doNote(chord);
  return (
    <>
      <table>
        <tr>
          <td>433</td>
          <td>Київ - Ковель</td>
          <td>5 годин</td>
        </tr>
        <tr>
          <td>701</td>
          <td>Харків - Дніпро</td>
          <td>7 годин</td>
        </tr>
        <tr>
          <td>258</td>
          <td>Львів - Одеса</td>
          <td>4 години</td>
        </tr>
      </table>
    </>
  );
}

function doNote() {}
